[virtual_sdcard]
path: /home/yanceya/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

## Voron Design VORON2 250/300/350mm BigTreeTech OctoPus V1 TMC2209 UART config
[include shell_command.cfg]
[include mainsail.cfg]  
[include macros.cfg]
[include homing_override.cfg]
[include heat_soak.cfg]
[include bedfans.cfg]
[include config_backup.cfg]
[include reshelper.cfg]
[include park_nozzle.cfg]
[include lazy_home.cfg]
[include KAMP_Settings.cfg]
#[include fan_tach_monitor.cfg]
[include K-ShakeTune/*.cfg]
#[include adxlmcu.cfg]
[include spoolman.cfg]
[include smart-m600.cfg]

[exclude_object]
[display_status]
[pause_resume]

[gcode_arcs] # Enable arcs support
resolution: 0.1

[mcu] ##  Obtain definition by "ls -l /dev/serial/by-id/" then unplug to verify
serial: /dev/serial/by-id/usb-Klipper_stm32f446xx_140041000450335331383520-if00
restart_method: command

##---- CAN SETUP -------
[mcu sht36v2]
canbus_uuid: 39ef95a209b6    #ffbfd8f87158  Id of fly-sht w/o max chip

[temperature_sensor SHT36-V2]     
sensor_type: temperature_mcu      
sensor_mcu: sht36v2               
min_temp: 0                       
max_temp: 490  

[neopixel HE_LEDS]
pin: sht36v2:PB0           
chain_count: 2              
color_order: GRBW           
initial_RED: 0            
initial_GREEN: 0          
initial_BLUE: 0             
initial_WHITE: 1  

[printer]
kinematics: corexy
max_velocity: 500
max_accel: 15000             #Max 4000
max_z_velocity: 30          #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 350
square_corner_velocity: 5.0

#####################################################################
#   X/Y Stepper Settings
#####################################################################
##  B Stepper - Left
##  Connected to MOTOR_0
##  Endstop connected to DIAG_0
[stepper_x]
step_pin: PF13
dir_pin: PF12
enable_pin: !PF14
rotation_distance: 40
microsteps: 128
full_steps_per_rotation:400  #set to 400 for 0.9 degree stepper

endstop_pin: tmc2240_stepper_x:virtual_endstop  #sensorless change from PG6
position_min: 0
position_endstop: 303
position_max: 303
##--------------------------------------------------------------------
use_sensorless_homing: true
homing_speed: 60   #sensorless , half of rotation distance
homing_retract_dist: 25 #sensorless change from 5
homing_positive_dir: true
min_home_dist: 20

##  Make sure to update below for your relevant driver (2208 or 2209)
#[tmc2209 stepper_x]
#uart_pin: PC4
#interpolate: false
#sense_resistor: 0.110
#stealthchop_threshold: 0
#diag_pin: ^PG6  #sensorless add, use the same pin that was previously the endstop_pin!
#driver_SGTHRS: 160 # sensorless 255 is most sensitive value, 0 is least sensitive

[tmc2240 stepper_x]
cs_pin: PC4
spi_software_sclk_pin: PA5
spi_software_mosi_pin: PA7
spi_software_miso_pin: PA6
diag0_pin: ^!PG6  #sensorless add, use the same pin that was previously the endstop_pin!
interpolate: false
run_current: 1.2
home_current: 0.6
#current_change_dwell_time: 0.5 #seconds

[autotune_tmc stepper_x]
motor: ldo-42sth48-2004mah #omc-17hs19-2004s1
sgt: -1

##  A Stepper - Right
##  Connected to MOTOR_1
##  Endstop connected to DIAG_1

[stepper_y]
step_pin: PG0
dir_pin: PG1
enable_pin: !PF15
rotation_distance: 40
microsteps: 128
full_steps_per_rotation:400  #set to 400 for 0.9 degree stepper
endstop_pin: tmc2240_stepper_y:virtual_endstop #sensorless change from PG9
position_min: 0
position_endstop: 295
position_max: 295
##--------------------------------------------------------------------
use_sensorless_homing: true
homing_speed: 60   #sensorless , half of rotation distance
homing_retract_dist: 25 #sensorless change from 5
homing_positive_dir: true
min_home_dist: 20

##  Make sure to update below for your relevant driver (2208 or 2209)
#[tmc2209 stepper_y]
#uart_pin: PD11
#interpolate: false
#sense_resistor: 0.110
#stealthchop_threshold: 0
#diag_pin: ^PG9    # use the same pin that was previously the endstop_pin!
#driver_SGTHRS: 160 # sensorless 255 is most sensitive value, 0 is least sensitive

[tmc2240 stepper_y]
cs_pin: PD11
spi_software_sclk_pin: PA5
spi_software_mosi_pin: PA7
spi_software_miso_pin: PA6
diag0_pin: ^!PG9    # use the same pin that was previously the endstop_pin!
interpolate: false
run_current: 1.2
home_current: 0.6

[autotune_tmc stepper_y]
motor: ldo-42sth48-2004mah #omc-17hs19-2004s1
sgt: -2

#####################################################################
#   Z Stepper Settings
#####################################################################
## Z0 Stepper - Front Left // Connected to MOTOR_2 //Endstop connected to DIAG_2
[stepper_z]
step_pin: PF11
dir_pin: !PG3
enable_pin: !PG5
rotation_distance: 40
gear_ratio: 80:16
microsteps: 64
endstop_pin: probe:z_virtual_endstop # use beacon as virtual endstop
homing_retract_dist: 0 # beacon needs this to be set to 0
position_max: 260 #300mm build
position_min: -5

[tmc2209 stepper_z]
uart_pin: PC6
interpolate: false
run_current: 0.8
sense_resistor: 0.110

[autotune_tmc stepper_z]
motor: omc-17hs19-2004s1

##  Z1 Stepper - Rear Left // Connected to MOTOR_3
[stepper_z1]
step_pin: PG4
dir_pin: PC1
enable_pin: !PA0
rotation_distance: 40
gear_ratio: 80:16
microsteps: 64

[tmc2209 stepper_z1]
uart_pin: PC7
interpolate: false
run_current: 0.8
sense_resistor: 0.110

[autotune_tmc stepper_z1]
motor: omc-17hs19-2004s1

##  Z2 Stepper - Rear Right // Connected to MOTOR_4
[stepper_z2]
step_pin: PF9
dir_pin: !PF10
enable_pin: !PG2
rotation_distance: 40
gear_ratio: 80:16
microsteps: 64

[tmc2209 stepper_z2]
uart_pin: PF2
interpolate: false
run_current: 0.8
sense_resistor: 0.110

[autotune_tmc stepper_z2]
motor: omc-17hs19-2004s1

##  Z3 Stepper - Front Right // Connected to MOTOR_5
[stepper_z3]
step_pin: PC13
dir_pin: PF0
enable_pin: !PF1
rotation_distance: 40
gear_ratio: 80:16
microsteps: 64

[tmc2209 stepper_z3]
uart_pin: PE4
interpolate: false
run_current: 0.8
sense_resistor: 0.110

[autotune_tmc stepper_z3]
motor: omc-17hs19-2004s1

#####################################################################
#   Extruder
#####################################################################
##  Connected to MOTOR_6 // Heater - HE0 // Thermistor - T0
[extruder]
step_pin: sht36v2:PB4  #CAN             
dir_pin: !sht36v2:PB3  #CAN
enable_pin: !sht36v2:PA15
rotation_distance: 22.67895   #for 5mm Shaft Driven Bondtech gearsets
gear_ratio: 50:8               #Sherpa Mini
microsteps: 16
full_steps_per_rotation: 200    #200 for 1.8 degree, 400 for 0.9 degree
nozzle_diameter: 0.500
filament_diameter: 1.75
heater_pin: sht36v2:PA8 #CAN
max_extrude_cross_section: 5 #for line purge macro

max_extrude_only_distance: 1400.0
max_extrude_only_velocity: 75.0
max_extrude_only_accel: 1500

pressure_advance_smooth_time: 0.015 #default
pressure_advance: 0.02 #default

##Hotend Thermistor
sensor_type: MAX31865   #PT1000
sensor_pin:  sht36v2:PB12    # sht36v2:PA3 #CAN
spi_bus: spi2
rtd_reference_r: 3290
rtd_nominal_r: 1000
rtd_num_of_wires: 2
min_temp: -50
max_temp: 350
max_power: 1.0
min_extrude_temp: 180

##  E0 on MOTOR6 - 36mm x 17mm LDO-36STH17-0354AHG  
[tmc2209 extruder]
uart_pin: sht36v2:PB5
interpolate: false
run_current: 0.30
sense_resistor: 0.110

[autotune_tmc extruder]
motor: ldo-36sth17-1004ahg
tuning_goal: performance

#####################################################################
#   Bed Heater
#####################################################################
##  SSR Pin - HE1 // Thermistor - TB
[heater_bed]
heater_pin: PA3
sensor_type: Generic 3950
sensor_pin: PF3
max_power: 1.0 ##  Adjust Max Power so your heater doesn't warp your bed. Rule of thumb is 0.4 watts / cm^2 .
min_temp: -5
max_temp: 120

[verify_heater heater_bed]
max_error: 500
check_gain_time: 600
hysteresis: 10
heating_gain: 2

#####################################################################
#   LED
#####################################################################
[led CaseLight]
white_pin: PB10
cycle_time: 0.001
initial_white: 0.1

#####################################################################
#   Probe
#####################################################################

[beacon]
serial: /dev/serial/by-id/usb-Beacon_Beacon_RevH_FC2690B64E5737374D202020FF0A4026-if00
x_offset: 0 # update with offset from nozzle on your machine
y_offset: 19 # update with offset from nozzle on your machine
mesh_main_direction: x  
mesh_runs: 2 
cal_nozzle_z: 0.2 #using 0.2 metal shim gauge
z_settling_time: 500
speed: 5
lift_speed: 5

[resonance_tester]
accel_chip: beacon
probe_points:
   150,150,20

[bed_mesh]
speed: 400
horizontal_move_z: 0
mesh_min: 20, 30 #y has to be above the beacon offset of 31
mesh_max: 275,250
probe_count: 60,60 #51,44 #[61,61]2408 -> tool adjusted 149.5,148.8 closest to bed center and z probe location #[29,29]420 # Values should be odd, so one point is directly at bed center
algorithm: bicubic
fade_start: 1
fade_end: 5
#zero_reference_position: 150,150
bicubic_tension: 0.4
#mesh_pps: 0,0


#####################################################################
#   Fan Control
#####################################################################

[temperature_fan Pi]
pin: PD14
sensor_type: temperature_host
kick_start_time: 0.5
off_below: 0.1
max_power: 0.8
shutdown_speed: 0
min_speed: 0.15
min_temp: -5
max_temp: 85
target_temp: 55
control: pid
pid_kp: 1.0
pid_ki: 0.5
pid_kd: 2.0

[temperature_fan Octopus]
pin: PD13
sensor_type: temperature_mcu
kick_start_time: 0.5
off_below: 0.1
max_power: 0.8
min_speed: 0.15
shutdown_speed: 0
min_temp: -5
max_temp: 85
target_temp: 55
control: pid
pid_kp: 1.0
pid_ki: 0.5
pid_kd: 2.0

##  Print Cooling Fan - FAN0
[fan]
pin: sht36v2:PB11 #FAN0
kick_start_time: 0.5
off_below: 0.05

##  Hotend Fan - FAN1
